import React from 'react'
import Header from '../EmployeeDashboard/Header'
import TopStats from '../TopStats'

  const Data = [
    {
       id: 0,
       title: 'Pending Orders',
       value: '40',
    },
    {
      id: 1,
      title: 'Serviced',
      value: '14',
   },
   {
    id: 2,
    title: 'Completed',
    value: '8',
 },
 {
  id: 3,
  title: 'Overall Status',
  value: 'On Time',
},
{
  id: 4,
  title: 'Hottest Area',
  value: 'Downtown',
},
{
  id: 5,
  title: 'Coldest Area',
  value: 'New York',
},
{
  id: 6,
  title: 'Complaint Probability',
  value: '10%',
  
},
  ]

const AllOrders = () => {
  return (
    <>
      <Header />
      <TopStats title={Data.title}/>
    </>
  )
}

export default AllOrders
